import { useContext } from "react";
import "./App.css";
import TestContext from "./contexts/TestContext";


const App = () => {

	const contextValue = useContext(TestContext);

	return (
		<div data-test="component-app">
			<h1>
			App {Json.stringify(contextValue)}
			</h1>
		</div>
	);
};

export default App;
